                        De cursos de extensão à graduação em Gestão da Informação, e de especialização e mestrado em Ciência, Gestão e Tecnologia da Informação, você vai encontrar os caminhos que levam à atuação profissional na dinâmica Sociedade da Informação e do Conhecimento em que vivemos.
                        <br />
    ");
                WriteLiteral(@"                    Esperamos que este Portal possa orientar estudantes, pesquisadores e profissionais na exploração das diversas perspectivas do trabalho na área da Gestão da Informação, servindo-lhes como referência à formação superior, básica ou continuada.
