                    <h3>Gestão da Informação</h3>
                    <br />
                    O curso de Gestão da Informação da Universidade Federal do Paraná foi o primeiro criado em uma universidade Pública no Brasil, em 1998. Seu currículo é multidisciplinar tendo como princípios norteadores a aprendizagem baseada em problemas e o espírito investigativo. As disciplinas integram conteúdos dos eixos de Ciência da Informação, Administração e Tecnologia da Informação. A formação é complementada com disciplinas contextuais e instrumentais e por atividades como estágios, extensão e pesquisa.
                    <br />
